import React from 'react';
import { Route, Routes } from 'react-router-dom';
import IngredientsDisplay from './ingredients';

export default function RoutesFunction() {
  return (
    <Routes>
      <Route path="/" element={<IngredientsDisplay />} />
    </Routes>
  );
}
